import Video from './demo_vids/social_distancing.mp4';
import Poster from './demo_vids/social_distancing.png';
import Img from './images/social_distancing.png';
export const sd = {
    lightBg: false,
    lightText: true,
    lightTextDesc: true,
    headline: 'Social Distancing Monitoring',
    description:
      'This feature for our product monitors if social distancing is being maintained properly. If not, an alert is generated.',
    imgStart: '',
    img: Img,
    alt: 'Credit Card',
    path: Video,
    poster: Poster
  };
